I'm currently obsessed with this topic: the powerful connection between nutrition and mental health. 🌱✨ Ever notice how your mood shifts after eating certain foods? I know I do!! You're not imagining it. Here's a bit of science behind it: Foods rich in omega-3 fatty acids, like salmon and walnuts, can enhance brain function and mood. They play a crucial role in building brain cell membranes and have anti-inflammatory properties that can help fight the blues. So maybe next time you're feeling a certain way, take a moment to think about what's on your plate. I found that certain foods I love that are high in sodium reek havoc on me mentally and physically. Ultimately these days I’m making healthier choices just because I don’t like the way it makes me feel afterwards. #foodismedicine #takewhatyouneed
